import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav>
      <ul>
        <li>
          Home
        </li>
        <li>
          About
        </li>
        <li>
          A
        </li>
        <li>
          Connect
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
